  static contextType = ThemeContext;

  render() {
    return (
      <>
        <h3>New Games</h3>

        <div style={{ overflow: 'scroll' }}>
          <div style={{ minWidth: '600px' }}>
            <Section {...layout}>
              <Section {...layout.items} style={{ border: '1px solid red' }}>
                <Card
                  style={{
                    height: '100px',
                    width: '100px',
                    borderRadius: '50%',
                    margin: '10px'
                  }}
