                    borderRadius: '50%',
                    margin: '10px'
                  }}
                >
                  7
                </Card>
              </Section>
              <Section {...layout.items} style={{ border: '1px solid red' }}>
                <Card
                  style={{
                    height: '100px',
                    width: '100px',
                    borderRadius: '50%',
                    margin: '10px'
                  }}
                >
                  8
                </Card>
              </Section>
            </Section>
          </div>
        </div>
      </>
    );
  }
}

export default NewGames;
